Все очень просто! Сноха вылила свой негатив на Вас, т. к. Вы:
1. Не дали деньги на комбинезон да входа в отдел магазина;
2. Поехали к ним домой;
3. Вас нужно было поставить в положение виновного, так легче ей будет получить с Вас сумму на весь комбинезон. Ваша сноха манипулятор, не поддавайтесь на провокации. Спокойно дождитесь когда сноха вынуждена будет попросить или спросить обещанные деньги на покупку.
